                <Carousel.Item>
                    <img className="d-block w-100" id="anne" src={anne} alt="Anne Bonny" />
                        <h3>Anne Bonny</h3>
                    <Carousel.Caption>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
    )
}

export default Home;
